import React from 'react';
import imgTable from '../assets/cycles_status_table.JPG';
import './CycleTable.css';




const CycleTable=(props)=>{

    let view=null;
    if (props.data.length>0)
    {

        view = props.data.map((row)=>{ return(<div>
            <table className="ui small table">
                <thead>
                <tr>
                    <th>Cycle_Id</th>
                    <th>Cycle Name</th>
                    <th>Running Executions</th>
                    <th>Pending Executions</th>
                    <th>Completed Pass</th>
                    <th>Completed Fail</th>
                </tr>
                </thead>
                <tbody>
                <tr>
                    <td>{row.ID}</td>
                    <td>{row.Description}</td>
                    <td>{row.Ex_}</td>
                    <td>2</td>
                    <td>0</td>
                    <td>1</td>
                </tr>
                </tbody>
                <tfoot>
                <tr>
                    <th>1</th>
                    <th></th>
                    <th>13</th>
                    <th>2</th>
                    <th>0</th>
                    <th>1</th>
                    <th></th>
                </tr>
                </tfoot>
            </table>
        </div>
    )}
    )
    }
    else{
        view='loading....';
    }
    return(
        <div>
            {view}
        </div>
    )
}

export default CycleTable;
